// placesReducer.js
const initialState = {
    place: null,
  };

  const placesReducer = (state = initialState, action) => {
    switch (action.type) {
      case 'SET_PLACE':
        return {
          ...state,
          place: action.payload,
        };
      default:
        return state;
    }
  };

  export default placesReducer;
